import React, { useState, useEffect } from "react";
import axios from "axios";

function AddEmployee() {
  const [employeeId, setEmployeeId] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");
  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    axios
      .post("http://localhost:8090/employees")
      .then((response) => {
        setEmployees(response.data);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

  function sendData(e) {
    e.preventDefault();
    const newEmployee = { employeeId, firstName, lastName, username, email, password, role };

    axios
      .post("http://localhost:8090/employees/create", newEmployee)
      .then(() => {
        alert("Employee added successfully!");
        setEmployeeId("");
        setFirstName("");
        setLastName("");
        setUsername("");
        setEmail("");
        setPassword("");
        setRole("");
      })
      .catch((err) => {
        console.error(err);
        alert("Failed to add employee.");
      });
  }

  return (
    <>
      <form onSubmit={sendData}>
        <div className="wrapper rounded bg-white">
          <div className="h3">Add Employee</div>

          <div className="form">
            <div className="row">
              <div className="col-md-6 mt-md-0 mt-3">
                <label>Employee ID</label>
                <input type="text" className="form-control" required value={employeeId} onChange={(e) => setEmployeeId(e.target.value)} />
              </div>
              <div className="col-md-6 mt-md-0 mt-3">
                <label>First Name</label>
                <input type="text" className="form-control" required value={firstName} onChange={(e) => setFirstName(e.target.value)} />
              </div>
            </div>

            <div className="row">
              <div className="col-md-6 mt-md-0 mt-3">
                <label>Last Name</label>
                <input type="text" className="form-control" required value={lastName} onChange={(e) => setLastName(e.target.value)} />
              </div>
              <div className="col-md-6 mt-md-0 mt-3">
                <label>Username</label>
                <input type="text" className="form-control" required value={username} onChange={(e) => setUsername(e.target.value)} />
              </div>
            </div>

            <div className="row">
              <div className="col-md-6 mt-md-0 mt-3">
                <label>Email</label>
                <input type="email" className="form-control" required value={email} onChange={(e) => setEmail(e.target.value)} />
              </div>
              <div className="col-md-6 mt-md-0 mt-3">
                <label>Password</label>
                <input type="password" className="form-control" required value={password} onChange={(e) => setPassword(e.target.value)} />
              </div>
            </div>

            <div className="col-md-6 mt-md-0 mt-3">
              <label>Role</label>
              <select className="form-control" required value={role} onChange={(e) => setRole(e.target.value)}>
                <option value="">Select Role</option>
                <option value="Vet">Vet</option>
                <option value="Groomer">Groomer</option>
              </select>
            </div>

            <button className="btn btn-primary mt-3">Add Employee</button>
          </div>
        </div>
      </form>
    </>
  );
}

export default AddEmployee;
